import styled from "styled-components";
import { motion } from "framer-motion";

const SearchComponentStyle = styled(motion.div)``;

const variants = {
  visible: (custom) => ({
    opacity: 1,
    transition: { delay: custom / 5 },
  }),
};

const SearchComponent = () => {
  return (
    <SearchComponentStyle>
      <input />
      <div className="suggest">
        <motion.span custom={1}> travel </motion.span>
        <motion.span custom={2}> travel </motion.span>
        <motion.span custom={3}> travel </motion.span>
      </div>
    </SearchComponentStyle>
  );
};
export default SearchComponent;
